- input: "TEXT\x1CC00431981\x1C.TEXT\x1C\x1CF3XA\x1CJune 13, 2008, Reference: Homecare
    & Hospice PAC Year End Report (7/1/07-12/31/07), Identification Number: C00431981
    \                                                                                                                                                                                     We
    have amended the Year End Report (7/1/07-12/31/07) and include the following explanation
    to address the items requiring further information.                           1.
    Per electronic verification, you are in receipt of our FORM 1M (Notification of
    Multicandidate Status) submitted electronically on 10/25/07 and assigned the filing
    ID of: 309449.                                                                                                                   2.
    Our original report discloses administrative expenses that we incurred and no
    additional expenses have been filed.  However, occasional use has been made of
    the facilities of the National Association for Home Care and Hospice by a volunteer
    for routine administration of the committee as allowed in the incidental use provision
    in 11 CFR 114.9(a).  No overhead or operating costs were increased as a result
    of this activity.                                                                                                                       3.
    Items 3 and 4 have been addressed by amending the report to categorize our Federal
    operating expenditure that should have been reported on line 21(b)."
